INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "カリン", 1, 0, 190804, 60000, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 1);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 1, 0, 60000, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 2);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 1, 0, 60000, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 3);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 2, "", 2, 1, 0, 60000, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 4);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 2, 0, 60000, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 5);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 2, 0, 60000, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 6);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 2, "", 2, 2, 0, 60000, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 7);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60000, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 8);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60000, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 9);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60000, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 10);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60000, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 11);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 2, "", 2, 3, 0, 60000, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 12);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60000, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 13);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60000, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 14);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60000, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 15);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60000, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 16);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 2, "", 2, 4, 0, 60000, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 17);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 0, "カリン", 3, 0, 190804, 60000, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 2, 18);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "カリン", 3, 0, 190804, 60000, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 19);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "ハツネ", 0, 0, 101201, 80001, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 1, 20);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "ハツネ", 0, 0, 101201, 80001, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 2, 21);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "シオリ", 1, 0, 103801, 80001, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 1, 22);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "シオリ", 1, 0, 103801, 80001, "来年も、\n一緒にいられたら…\nうれしいな", 2, 23);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "キョウカ", 0, 0, 103601, 80001, "あなたと一緒にいるようになって、\nもう1年ですか…", 1, 24);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "キョウカ", 0, 0, 103601, 80001, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 2, 25);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "ミミ", 1, 0, 102001, 80001, "おにいちゃんとあってから、\n1年たったよ～！", 1, 26);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "ミミ", 1, 0, 102001, 80001, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 2, 27);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "ミソギ", 2, 0, 100401, 80001, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 1, 28);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "ミソギ", 2, 0, 100401, 80001, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 2, 29);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "マホ", 0, 0, 101001, 80001, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 1, 30);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "マホ", 0, 0, 101001, 80001, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 2, 31);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "イリヤ", 1, 0, 104401, 80001, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 1, 32);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "イリヤ", 1, 0, 104401, 80001, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 2, 33);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "カオリ", 2, 0, 101701, 80001, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 1, 34);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "カオリ", 2, 0, 101701, 80001, "これからも、どうぞよろしく\nお願いするさ～！", 2, 35);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "サレン", 0, 0, 102801, 80001, "あんたと出会ってからもうそんなに\nたつのね～", 1, 36);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "サレン", 0, 0, 102801, 80001, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 2, 37);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "スズメ", 1, 0, 102501, 80001, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 1, 38);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "スズメ", 1, 0, 102501, 80001, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 2, 39);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "タマキ", 0, 0, 104601, 80001, "振り返れば、今までいろんなことが\nあったにゃあ…", 1, 40);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "タマキ", 0, 0, 104601, 80001, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 2, 41);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "ミフユ", 1, 0, 104801, 80001, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 1, 42);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "ミフユ", 1, 0, 104801, 80001, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 2, 43);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "アキノ", 0, 0, 103201, 80001, "あなたさまと出会ってもう1年…", 1, 44);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "アキノ", 0, 0, 103201, 80001, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 2, 45);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "ユカリ", 1, 0, 103401, 80001, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 1, 46);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "ユカリ", 1, 0, 103401, 80001, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 2, 47);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "クリスティーナ", 0, 0, 107101, 80001, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 1, 48);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "クリスティーナ", 0, 0, 107101, 80001, "ともかくこれからも\n愉しませてくれよ☆", 2, 49);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "ジュン", 1, 0, 104701, 80001, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 1, 50);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "ジュン", 1, 0, 104701, 80001, "見えないから分からないって？\nそれもそうだな…", 2, 51);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "トモ", 0, 0, 103701, 80001, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 1, 52);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "トモ", 0, 0, 103701, 80001, "これからもよろしくね！", 2, 53);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "マツリ", 1, 0, 100501, 80001, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 1, 54);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "マツリ", 1, 0, 100501, 80001, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 2, 55);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "ミヤコ", 0, 0, 100701, 80001, "オマエと会って1年なの！\n全然成仏もできなかったし、", 1, 56);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "ミヤコ", 0, 0, 100701, 80001, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 2, 57);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "シノブ", 1, 0, 103101, 80001, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 1, 58);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "シノブ", 1, 0, 103101, 80001, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 2, 59);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "アンナ", 0, 0, 100901, 80001, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 1, 60);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "アンナ", 0, 0, 100901, 80001, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 2, 61);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "ナナカ", 1, 0, 101301, 80001, "君と出会ってもう1年だって！\n早いねー！", 1, 62);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "ナナカ", 1, 0, 101301, 80001, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 2, 63);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "ミツキ", 0, 0, 105101, 80001, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 1, 64);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "ミツキ", 0, 0, 105101, 80001, "これからも、いろんなところを\n調べさせてね？", 2, 65);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "ルカ", 1, 0, 105601, 80001, "お前さんと出会ってもう1年か\n助太刀するつもりが", 1, 66);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "ルカ", 1, 0, 105601, 80001, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 2, 67);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "エリコ", 2, 0, 102701, 80001, "早いものですわね、あなた様と\nお会いして、もう1年…", 1, 68);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "エリコ", 2, 0, 102701, 80001, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 2, 69);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "アヤネ", 0, 0, 102301, 80001, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 1, 70);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "アヤネ", 0, 0, 102301, 80001, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 2, 71);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "チカ", 1, 0, 104201, 80001, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 1, 72);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "チカ", 1, 0, 104201, 80001, "私のことを見守ってください\nできることなら、ずっと…", 2, 73);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "クルミ", 2, 0, 102101, 80001, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 1, 74);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "クルミ", 2, 0, 102101, 80001, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 2, 75);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "シズル", 0, 0, 104901, 80001, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 1, 76);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "シズル", 0, 0, 104901, 80001, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 2, 77);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "リノ", 1, 0, 101101, 80001, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 1, 78);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "リノ", 1, 0, 101101, 80001, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 2, 79);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "ユイ", 0, 0, 100201, 80001, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 1, 80);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "ユイ", 0, 0, 100201, 80001, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 2, 81);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "ヒヨリ", 1, 0, 100101, 80001, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 1, 82);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "ヒヨリ", 1, 0, 100101, 80001, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 2, 83);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "レイ", 2, 0, 100301, 80001, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 1, 84);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "レイ", 2, 0, 100301, 80001, "キミに背中を預けられる日が、\n早くきますように", 2, 85);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "ペコリーヌ", 0, 0, 105801, 80001, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 1, 86);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "ペコリーヌ", 0, 0, 105801, 80001, "これからもずっと、覚えていて\nくださいね！", 2, 87);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "コッコロ", 1, 0, 105901, 80001, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 1, 88);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "コッコロ", 1, 0, 105901, 80001, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 2, 89);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "キャル", 2, 0, 106001, 80001, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 1, 90);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "キャル", 2, 0, 106001, 80001, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 2, 91);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "スズメ", 1, 0, 112101, 60001, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 1, 92);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 1, 0, 60001, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 93);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 1, 0, 60001, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 94);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 1, 0, 60001, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 95);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 1, 0, 60001, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 96);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 2, "", 2, 1, 0, 60001, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 97);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 2, 0, 60001, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 98);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 2, 0, 60001, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 99);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 2, 0, 60001, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 100);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 2, 0, 60001, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 101);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 2, "", 2, 2, 0, 60001, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 102);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60001, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 103);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60001, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 104);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60001, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 105);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60001, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 106);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60001, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0, 107);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60001, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0, 108);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 2, "", 2, 3, 0, 60001, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 109);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60001, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 110);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60001, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 111);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60001, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 112);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60001, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 113);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60001, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 114);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60001, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0, 115);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 2, "", 2, 4, 0, 60001, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 116);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 0, "スズメ", 3, 0, 112101, 60001, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 2, 117);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "スズメ", 3, 0, 112101, 60001, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 3, 118);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "ヒューヒュー♪\nドンドンパフパフー♪", 1, 119);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "コッコロ", 1, 0, 105901, 80003, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 1, 120);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "コッコロ", 1, 0, 105901, 80003, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 2, 121);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "キャル", 2, 0, 106001, 80003, "え？　ちょっと\nいきなりなにっ？", 1, 122);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "キャル", 2, 0, 106001, 80003, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 2, 123);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 2, 124);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 3, 125);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "コッコロ", 1, 0, 105901, 80003, "ですからその日に向けて\n今から気分を盛り上げているのです", 3, 126);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "キャル", 2, 0, 106001, 80003, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 3, 127);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "コッコロ", 1, 0, 105901, 80003, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 4, 128);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 4, 129);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "キャル", 2, 0, 106001, 80003, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 4, 130);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "コッコロ", 1, 0, 105901, 80003, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 5, 131);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "キャル", 0, 0, 106001, 80003, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 5, 132);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "カリン", 1, 0, 190801, 80003, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 1, 133);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "キャル", 0, 0, 106001, 80003, "げっ…カリンじゃない\nなんでもないわよ！", 6, 134);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "カリン", 1, 0, 190801, 80003, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 2, 135);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "キャル", 0, 0, 106001, 80003, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 7, 136);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "カリン", 1, 0, 190801, 80003, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 3, 137);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "キャル", 0, 0, 106001, 80003, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 8, 138);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "キャル", 0, 0, 106001, 80003, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 9, 139);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "カリン", 1, 0, 190801, 80003, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 4, 140);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "キャル", 0, 0, 106001, 80003, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 10, 141);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "カリン", 1, 0, 190801, 80003, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 5, 142);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "キャル", 0, 0, 106001, 80003, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 11, 143);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "コッコロ", 0, 0, 105901, 80003, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 6, 144);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "ペコリーヌ", 1, 0, 105801, 80003, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 5, 145);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "コッコロ", 0, 0, 105901, 80003, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 7, 146);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "コッコロ", 0, 0, 105901, 80003, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 8, 147);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "ペコリーヌ", 1, 0, 105801, 80003, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 6, 148);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "ペコリーヌ", 1, 0, 105801, 80003, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 7, 149);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "コッコロ", 0, 0, 105901, 80003, "あとは、牧場に素敵な温泉が\n出来たとか…", 9, 150);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "ペコリーヌ", 1, 0, 105801, 80003, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 8, 151);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "コッコロ", 0, 0, 105901, 80003, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 10, 152);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "ペコリーヌ", 1, 0, 105801, 80003, "えへへ、ありがとうございます\nコッコロちゃん！", 9, 153);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "コッコロ", 0, 0, 105901, 80003, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 11, 154);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "ペコリーヌ", 1, 0, 105801, 80003, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 10, 155);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 11, 156);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "キャル", 1, 0, 106001, 80003, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 12, 157);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 12, 158);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "キャル", 1, 0, 106001, 80003, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 13, 159);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 13, 160);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "キャル", 1, 0, 106001, 80003, "…積極的？\nなんの話よ？", 14, 161);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 14, 162);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "ムーサの町で\nきゃるきゃる～ん☆　って！", 15, 163);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "キャル", 1, 0, 106001, 80003, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 15, 164);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 16, 165);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "キャル", 1, 0, 106001, 80003, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 16, 166);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "キャル", 1, 0, 106001, 80003, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 17, 167);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "キャル", 0, 0, 106001, 80003, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 18, 168);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "コッコロ", 1, 0, 105901, 80003, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 12, 169);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "キャル", 0, 0, 106001, 80003, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 19, 170);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "コッコロ", 1, 0, 105901, 80003, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 13, 171);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "キャル", 0, 0, 106001, 80003, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 20, 172);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "コッコロ", 1, 0, 105901, 80003, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 14, 173);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "キャル", 0, 0, 106001, 80003, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 21, 174);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "コッコロ", 1, 0, 105901, 80003, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 15, 175);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "キャル", 0, 0, 106001, 80003, "かくし芸？", 22, 176);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "コッコロ", 1, 0, 105901, 80003, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 16, 177);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "キャル", 0, 0, 106001, 80003, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 23, 178);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 17, 179);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "キャル", 2, 0, 106001, 80003, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 24, 180);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "コッコロ", 1, 0, 105901, 80003, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 17, 181);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 18, 182);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "キャル", 2, 0, 106001, 80003, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 25, 183);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "コッコロ", 1, 0, 105901, 80003, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 18, 184);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "キャル", 2, 0, 106001, 80003, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 26, 185);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "キャル", 2, 0, 106001, 80003, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 27, 186);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "キャル", 2, 0, 106001, 80003, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 28, 187);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 19, 188);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "コッコロ", 1, 0, 105901, 80003, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 19, 189);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "キャル", 2, 0, 106001, 80003, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 29, 190);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "キャル", 0, 0, 106001, 80003, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 30, 191);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "キャル", 0, 0, 106001, 80003, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 31, 192);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "キャル", 0, 0, 106001, 80003, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 32, 193);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "キャル", 0, 0, 106001, 80003, "あー\nあー\n…声、これで大丈夫かしら？", 33, 194);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "キャル", 0, 0, 106001, 80003, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 34, 195);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "キャル", 0, 0, 106001, 80003, "オイッスー☆", 35, 196);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "キャル", 0, 0, 106001, 80003, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 36, 197);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "キャル", 0, 0, 106001, 80003, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 37, 198);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "キャル", 0, 0, 106001, 80003, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 38, 199);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "コッコロ", 0, 0, 105901, 80003, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 20, 200);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "コッコロ", 0, 0, 105901, 80003, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 21, 201);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "コッコロ", 0, 0, 105901, 80003, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 22, 202);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "コッコロ", 0, 0, 105901, 80003, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 23, 203);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "コッコロ", 0, 0, 105901, 80003, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 24, 204);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "コッコロ", 0, 0, 105901, 80003, "オイッスー☆", 25, 205);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "コッコロ", 0, 0, 105901, 80003, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 26, 206);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "コッコロ", 0, 0, 105901, 80003, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 27, 207);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "コッコロ", 0, 0, 105901, 80003, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 28, 208);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "オイッスー☆", 20, 209);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 21, 210);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "あと６日で2.5周年ですか…", 22, 211);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 23, 212);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 24, 213);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "オイッスー☆", 25, 214);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 26, 215);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 27, 216);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 28, 217);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 29, 218);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 30, 219);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 31, 220);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "コッコロ", 1, 0, 105901, 80003, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 29, 221);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 32, 222);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "キャル", 2, 0, 106001, 80003, "…………", 39, 223);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "コッコロ", 1, 0, 105901, 80003, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 30, 224);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "キャル", 2, 0, 106001, 80003, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 40, 225);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 33, 226);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "キャル", 2, 0, 106001, 80003, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 41, 227);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 34, 228);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 35, 229);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "キャル", 2, 0, 106001, 80003, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 42, 230);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "コッコロ", 1, 0, 105901, 80003, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 31, 231);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "キャル", 2, 0, 106001, 80003, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 43, 232);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 36, 233);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "カリン", 0, 0, 190801, 80003, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 6, 234);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "カリン", 0, 0, 190801, 80003, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 7, 235);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "カリン", 0, 0, 190801, 80003, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 8, 236);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "カリン", 0, 0, 190801, 80003, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 9, 237);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "カリン", 0, 0, 190801, 80003, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 10, 238);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "カリン", 0, 0, 190801, 80003, "次にコッコロさんですが\nこちらは発声練習をしています", 11, 239);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "カリン", 0, 0, 190801, 80003, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 12, 240);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "カリン", 0, 0, 190801, 80003, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 13, 241);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "カリン", 0, 0, 190801, 80003, "あれ？\nもしかして緊張で気を失って…？", 14, 242);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "カリン", 0, 0, 190801, 80003, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 15, 243);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "カリン", 0, 0, 190801, 80003, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 16, 244);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "カリン", 0, 0, 190801, 80003, "それでは\nまた明日お会いしましょう♪", 17, 245);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "キャル", 0, 0, 106001, 80003, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 44, 246);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "ペコリーヌ", 2, 0, 105801, 80003, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 37, 247);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "コッコロ", 1, 0, 105901, 80003, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 32, 248);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "キャル", 0, 0, 106001, 80003, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 45, 249);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "ペコリーヌ", 2, 0, 105801, 80003, "ひどいですよぉキャルちゃ～ん！", 38, 250);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "コッコロ", 1, 0, 105901, 80003, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 33, 251);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "ペコリーヌ", 2, 0, 105801, 80003, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 39, 252);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "キャル", 0, 0, 106001, 80003, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 46, 253);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "コッコロ", 1, 0, 105901, 80003, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 34, 254);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "ペコリーヌ", 2, 0, 105801, 80003, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 40, 255);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 41, 256);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "キャル", 2, 0, 106001, 80003, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 47, 257);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "忘れてきちゃいました☆", 42, 258);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "キャル", 2, 0, 106001, 80003, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 48, 259);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "コッコロ", 1, 0, 105901, 80003, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 35, 260);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "キャル", 2, 0, 106001, 80003, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 49, 261);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 43, 262);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "キャル", 2, 0, 106001, 80003, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 50, 263);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "コッコロ", 1, 0, 105901, 80003, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 36, 264);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "キャル", 2, 0, 106001, 80003, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 51, 265);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "コッコロ", 1, 0, 105901, 80003, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 37, 266);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "キャル", 2, 0, 106001, 80003, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 52, 267);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 44, 268);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "コッコロ", 1, 0, 105901, 80003, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 38, 269);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 45, 270);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "キャル", 2, 0, 106001, 80003, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 53, 271);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 46, 272);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "カリン", 0, 0, 190801, 80003, "こんにちは\n【ギルド管理協会】のカリンです", 18, 273);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "カリン", 0, 0, 190801, 80003, "昨日の生放送は\nいかがだったでしょうか？", 19, 274);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "カリン", 0, 0, 190801, 80003, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 20, 275);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "カリン", 0, 0, 190801, 80003, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 21, 276);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "カリン", 0, 0, 190801, 80003, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 22, 277);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "カリン", 0, 0, 190801, 80003, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 23, 278);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "カリン", 0, 0, 190801, 80003, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 24, 279);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "カリン", 0, 0, 190801, 80003, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 25, 280);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "カリン", 0, 0, 190801, 80003, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 26, 281);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "カリン", 0, 0, 190801, 80003, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 27, 282);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "準備はいいですかっ？\n…いっきますよー！", 47, 283);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "キャル", 2, 0, 106001, 80003, "祝！", 54, 284);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "コッコロ", 1, 0, 105901, 80003, "2.5周年！", 39, 285);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "おめでとうございま～す☆", 48, 286);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "キャル", 2, 0, 106001, 80003, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 55, 287);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "コッコロ", 1, 0, 105901, 80003, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 40, 288);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 49, 289);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "キャル", 2, 0, 106001, 80003, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 56, 290);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "コッコロ", 1, 0, 105901, 80003, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 41, 291);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "キャル", 2, 0, 106001, 80003, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 57, 292);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 50, 293);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "キャル", 2, 0, 106001, 80003, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 58, 294);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "記念日だから\n平気平気♪\nやばいですね☆", 51, 295);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "キャル", 2, 0, 106001, 80003, "意味分かんないわよ！", 59, 296);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "コッコロ", 1, 0, 105901, 80003, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 42, 297);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "コッコロ", 1, 0, 105901, 80003, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 43, 298);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 52, 299);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "キャル", 2, 0, 106001, 80003, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 60, 300);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "コッコロ", 1, 0, 105901, 80003, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 44, 301);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "ペコリーヌ", 0, 0, 105801, 80003, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 53, 302);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (1, 15, "105901,45,106001,61", 0, "ペコリーヌ・コッコロ・キャル", 0, 0, 105801, 80003, "2.5周年\nありがとうございます！", 54, 303);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "カリン", 1, 0, 190804, 60002, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 304);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 1, 0, 60002, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 305);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 1, 0, 60002, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 306);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 1, 0, 60002, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 307);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 1, 0, 60002, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 308);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 2, "", 2, 1, 0, 60002, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 309);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 2, 0, 60002, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 310);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 2, 0, 60002, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 311);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 2, 0, 60002, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 312);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 2, 0, 60002, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 313);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 2, "", 2, 2, 0, 60002, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 314);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60002, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 315);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60002, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 316);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60002, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 317);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60002, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 318);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60002, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 0, 319);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60002, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 320);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 2, "", 2, 3, 0, 60002, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 0, 321);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60002, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 322);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60002, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 323);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60002, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 324);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60002, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 325);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60002, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 326);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60002, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 327);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 2, "", 2, 4, 0, 60002, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 328);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 0, "カリン", 3, 0, 190804, 60002, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 2, 329);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "カリン", 3, 0, 190804, 60002, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 330);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "コッコロ", 4, 0, 105901, 80005, "ささ、シェフィさまはこちらへ…", 1, 331);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "シェフィ", 0, 0, 106401, 80005, "コッコロさん、どこへ行くの…？\n…え？", 1, 332);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 1, 333);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "コッコロ", 4, 0, 105901, 80005, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 2, 334);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "シェフィ", 0, 0, 106401, 80005, "ええと…\n二人とも何をしているの？", 2, 335);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "キャル", 1, 0, 106001, 80005, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 1, 336);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "シェフィ", 0, 0, 106401, 80005, "あの日…？", 3, 337);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 2, 338);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 3, 339);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "カリン", 2, 0, 190801, 80005, "やばいですね☆", 1, 340);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "キャル", 1, 0, 106001, 80005, "って、なにしれっと\n参加してんのよカリン！", 2, 341);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "カリン", 2, 0, 190801, 80005, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 2, 342);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "カリン", 2, 0, 190801, 80005, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 3, 343);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 4, 344);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 1, "", 0, "シェフィ", 0, 0, 106401, 80005, "えっ！？　ええとええと…！\nあ、あと14日…！", 4, 345);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 5, 346);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "コッコロ", 1, 0, 105901, 80005, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 3, 347);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "コッコロ", 1, 0, 105901, 80005, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 4, 348);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 6, 349);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "コッコロ", 1, 0, 105901, 80005, "さすがでございます\nペコリーヌさま", 5, 350);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "キャル", 0, 0, 106001, 80005, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 3, 351);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "シェフィ", 2, 0, 106401, 80005, "しゃなり、しゃなり…\nふふ、案外できるものね", 5, 352);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 7, 353);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "コッコロ", 1, 0, 105901, 80005, "さ、次はキャルさまの\n番でございますよ", 6, 354);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "キャル", 0, 0, 106001, 80005, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 4, 355);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "シェフィ", 2, 0, 106401, 80005, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 6, 356);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "キャル", 0, 0, 106001, 80005, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 5, 357);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "キャル", 0, 0, 106001, 80005, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 6, 358);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "コッコロ", 1, 0, 105901, 80005, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 7, 359);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 2, "", 0, "キャル", 0, 0, 106001, 80005, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 7, 360);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "コッコロ", 1, 0, 105901, 80005, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 8, 361);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 8, 362);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "コッコロ", 1, 0, 105901, 80005, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 9, 363);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "シェフィ", 2, 0, 106401, 80005, "聖学祭…って、なにかしら？", 7, 364);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "コッコロ", 1, 0, 105901, 80005, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 10, 365);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "キャル", 0, 0, 106001, 80005, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 8, 366);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "キャル", 0, 0, 106001, 80005, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 9, 367);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 9, 368);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "キャル", 0, 0, 106001, 80005, "いや、そのまんますぎでしょ…", 10, 369);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "シェフィ", 2, 0, 106401, 80005, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 8, 370);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 10, 371);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 3, "", 0, "シェフィ", 2, 0, 106401, 80005, "えっ？　ええ…\nぎゅーっ…？", 9, 372);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "キャル", 0, 0, 106001, 80005, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 11, 373);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "シェフィ", 2, 0, 106401, 80005, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 10, 374);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "キャル", 0, 0, 106001, 80005, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 12, 375);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "コッコロ", 1, 0, 105901, 80005, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 11, 376);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "キャル", 0, 0, 106001, 80005, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 13, 377);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 11, 378);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "キャル", 0, 0, 106001, 80005, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 14, 379);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "キャル", 0, 0, 106001, 80005, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 15, 380);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "シェフィ", 2, 0, 106401, 80005, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 11, 381);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 12, 382);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "コッコロ", 1, 0, 105901, 80005, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 12, 383);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "キャル", 0, 0, 106001, 80005, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 16, 384);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 4, "", 0, "シェフィ", 2, 0, 106401, 80005, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 12, 385);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 13, 386);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 14, 387);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 15, 388);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "キャル", 0, 0, 106001, 80005, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 17, 389);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "キャル", 0, 0, 106001, 80005, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 18, 390);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "シェフィ", 2, 0, 106401, 80005, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 13, 391);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "コッコロ", 1, 0, 105901, 80005, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 13, 392);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 16, 393);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "キャル", 0, 0, 106001, 80005, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 19, 394);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 17, 395);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 18, 396);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 5, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 19, 397);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "カリン", 2, 0, 190801, 80005, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 4, 398);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "カリン", 2, 0, 190801, 80005, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 5, 399);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "キャル", 1, 0, 106001, 80005, "…えっ！？", 20, 400);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 20, 401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "シェフィ", 0, 0, 106401, 80005, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 14, 402);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "コッコロ", 4, 0, 105901, 80005, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 14, 403);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "シェフィ", 0, 0, 106401, 80005, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 15, 404);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "キャル", 1, 0, 106001, 80005, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 21, 405);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 21, 406);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "キャル", 1, 0, 106001, 80005, "ぶっ殺すぞ！？", 22, 407);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 6, "", 0, "カリン", 2, 0, 190801, 80005, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 6, 408);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "コッコロ", 1, 0, 105901, 80005, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 15, 409);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "キャル", 0, 0, 106001, 80005, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 23, 410);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "シェフィ", 2, 0, 106401, 80005, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 16, 411);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 22, 412);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "キャル", 0, 0, 106001, 80005, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 24, 413);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "シェフィ", 2, 0, 106401, 80005, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 17, 414);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "コッコロ", 1, 0, 105901, 80005, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 16, 415);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "シェフィ", 2, 0, 106401, 80005, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 18, 416);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "コッコロ", 1, 0, 105901, 80005, "もちろんでございます\n仲良くお勉強いたしましょう", 17, 417);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "キャル", 0, 0, 106001, 80005, "しれっと教育ママが\n生まれてる…？", 25, 418);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 23, 419);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 7, "", 0, "キャル", 0, 0, 106001, 80005, "え～～～～！？", 26, 420);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "キャル", 0, 0, 106001, 80005, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 27, 421);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "シェフィ", 2, 0, 106401, 80005, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 19, 422);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "コッコロ", 1, 0, 105901, 80005, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 18, 423);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 24, 424);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "シェフィ", 2, 0, 106401, 80005, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 20, 425);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "キャル", 0, 0, 106001, 80005, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 28, 426);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "コッコロ", 1, 0, 105901, 80005, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 19, 427);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "シェフィ", 2, 0, 106401, 80005, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 21, 428);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "キャル", 0, 0, 106001, 80005, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 29, 429);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "キャル", 0, 0, 106001, 80005, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 30, 430);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 25, 431);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 8, "", 0, "キャル", 0, 0, 106001, 80005, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 31, 432);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "シェフィ", 0, 0, 106401, 80005, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 22, 433);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "シェフィ", 0, 0, 106401, 80005, "…えっ？\n生放送の意気込み！？\n突然なに！？", 23, 434);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "シェフィ", 0, 0, 106401, 80005, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 24, 435);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "シェフィ", 0, 0, 106401, 80005, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 25, 436);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "シェフィ", 0, 0, 106401, 80005, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 26, 437);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "シェフィ", 0, 0, 106401, 80005, "それから、それから…！\nぅ、ぅぅっ…！", 27, 438);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "シェフィ", 0, 0, 106401, 80005, "―びえぇぇ～んっ！！！", 28, 439);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "コッコロ", 1, 0, 105901, 80005, "どうされましたか、シェフィさま", 20, 440);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "シェフィ", 0, 0, 106401, 80005, "ううっ…ひっく…\nママッ…！", 29, 441);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "コッコロ", 1, 0, 105901, 80005, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 21, 442);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "コッコロ", 1, 0, 105901, 80005, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 22, 443);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 9, "", 0, "シェフィ", 0, 0, 106401, 80005, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 30, 444);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "コッコロ", 0, 0, 105901, 80005, "主さま\n3.5周年まであと５日\nでございます", 23, 445);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "コッコロ", 0, 0, 105901, 80005, "ですがその前に\n生放送がありますね", 24, 446);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "コッコロ", 0, 0, 105901, 80005, "…生放送に向けた\n意気込みでございますか？", 25, 447);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "コッコロ", 0, 0, 105901, 80005, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 26, 448);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "コッコロ", 0, 0, 105901, 80005, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 27, 449);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "コッコロ", 0, 0, 105901, 80005, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 28, 450);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "コッコロ", 0, 0, 105901, 80005, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 29, 451);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "コッコロ", 0, 0, 105901, 80005, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 30, 452);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 10, "", 0, "コッコロ", 0, 0, 105901, 80005, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 31, 453);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "ペコリーヌ", 0, 0, 105801, 80005, "3.5周年まであと４日！\nやばいですね☆", 26, 454);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "キャル", 1, 0, 106001, 80005, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 32, 455);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "ペコリーヌ", 0, 0, 105801, 80005, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 27, 456);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "ペコリーヌ", 0, 0, 105801, 80005, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 28, 457);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "ペコリーヌ", 0, 0, 105801, 80005, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 29, 458);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "キャル", 1, 0, 106001, 80005, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 33, 459);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "ペコリーヌ", 0, 0, 105801, 80005, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 30, 460);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "ペコリーヌ", 0, 0, 105801, 80005, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 31, 461);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "ペコリーヌ", 0, 0, 105801, 80005, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 32, 462);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "キャル", 1, 0, 106001, 80005, "だからあたしはやるなんて一言も…", 34, 463);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "ペコリーヌ", 0, 0, 105801, 80005, "オイッスー☆", 33, 464);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 11, "", 0, "キャル", 1, 0, 106001, 80005, "聞きなさいっての！！", 35, 465);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "シェフィ", 2, 0, 106401, 80005, "3.5周年まであと３日…\nそして生放送は、明日…", 31, 466);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "シェフィ", 2, 0, 106401, 80005, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 32, 467);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "シェフィ", 2, 0, 106401, 80005, "おいっす！\n…こうじゃなかったわね\nええと確か…", 33, 468);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "シェフィ", 2, 0, 106401, 80005, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 34, 469);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "シェフィ", 2, 0, 106401, 80005, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 35, 470);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "やってますねシェフィちゃん！", 34, 471);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "キャル", 0, 0, 106001, 80005, "なによ、考えることは\nみんな同じってこと？", 36, 472);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "コッコロ", 1, 0, 105901, 80005, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 32, 473);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "シェフィ", 2, 0, 106401, 80005, "みんな…もちろんよ！", 36, 474);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 12, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 35, 475);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "カリン", 2, 0, 190801, 80005, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 7, 476);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "カリン", 2, 0, 190801, 80005, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 8, 477);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 36, 478);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "カリン", 2, 0, 190801, 80005, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 9, 479);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "コッコロ", 4, 0, 105901, 80005, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 33, 480);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "カリン", 2, 0, 190801, 80005, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 10, 481);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "キャル", 1, 0, 106001, 80005, "大丈夫…大丈夫…\nあたしは大丈夫…", 37, 482);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "カリン", 2, 0, 190801, 80005, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 11, 483);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "シェフィ", 0, 0, 106401, 80005, "あうー？", 37, 484);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (1, 13, "105901,34,106001,38,190801,12", 0, "みんな", 4, 0, 105801, 80005, "あ…", 37, 485);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "キャル", 1, 0, 106001, 80005, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 39, 486);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "コッコロ", 4, 0, 105901, 80005, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 35, 487);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 38, 488);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 13, "", 0, "カリン", 2, 0, 190801, 80005, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 13, 489);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "シェフィ", 2, 0, 106401, 80005, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 38, 490);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 39, 491);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "キャル", 0, 0, 106001, 80005, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 40, 492);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "コッコロ", 1, 0, 105901, 80005, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 36, 493);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "シェフィ", 2, 0, 106401, 80005, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 39, 494);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 40, 495);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "コッコロ", 1, 0, 105901, 80005, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 37, 496);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "キャル", 0, 0, 106001, 80005, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 41, 497);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "シェフィ", 2, 0, 106401, 80005, "へ、へぇ…", 40, 498);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 41, 499);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "シェフィ", 2, 0, 106401, 80005, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 41, 500);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 14, "", 0, "シェフィ", 2, 0, 106401, 80005, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 42, 501);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 42, 502);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "キャル", 1, 0, 106001, 80005, "祝！", 42, 503);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "コッコロ", 4, 0, 105901, 80005, "3.5周年！", 38, 504);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "シェフィ", 0, 0, 106401, 80005, "おめでとうございます！", 43, 505);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "カリン", 2, 0, 190801, 80005, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 14, 506);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "カリン", 2, 0, 190801, 80005, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 15, 507);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 43, 508);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 44, 509);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "キャル", 1, 0, 106001, 80005, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 43, 510);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "キャル", 1, 0, 106001, 80005, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 44, 511);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "シェフィ", 0, 0, 106401, 80005, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 44, 512);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "シェフィ", 0, 0, 106401, 80005, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 45, 513);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "コッコロ", 4, 0, 105901, 80005, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 39, 514);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "コッコロ", 4, 0, 105901, 80005, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 40, 515);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "コッコロ", 4, 0, 105901, 80005, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 41, 516);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 15, "", 0, "ペコリーヌ", 3, 0, 105801, 80005, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 45, 517);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (1, 15, "105901,42,106001,45,106401,46,190801,16", 0, "みんな", 4, 0, 105801, 80005, "これからも\nよろしくおねがいします！", 46, 518);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "カリン", 1, 0, 190804, 60003, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 519);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 1, 0, 60003, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 520);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 1, 0, 60003, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 521);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 1, 0, 60003, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0, 522);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 1, 0, 60003, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 0, 523);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 2, "", 2, 1, 0, 60003, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 524);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 2, 0, 60003, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 525);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 2, 0, 60003, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 526);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 2, 0, 60003, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 0, 527);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 2, 0, 60003, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 0, 528);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 2, "", 2, 2, 0, 60003, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 529);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60003, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 530);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60003, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 531);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60003, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 532);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60003, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 533);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60003, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 0, 534);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 3, 0, 60003, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 535);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 2, "", 2, 3, 0, 60003, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 0, 536);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60003, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 537);
