INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 0, "", 1, "", 2, 4, 0, 60003, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 539);
